('42','1','<div id=\"wrap_id_advice_515\" >\n		<section id=\"0_ogone\" class=\"panel \" style=\"display:none\">\n			<header class=\"panel-heading\">\n				<span class=\"icon-lightbulb\"></span> Tips of the day</header>\n			<div class=\"panel-body\" style=\"padding:0\">\n				<img class=\"img-responsive\" src=\"https://api.prestashop.com/partner/tipsoftheday/img/logo-ogone.png\" style=\"float:right; margin-left: 5px;\">\n				<img src=\"https://gamification.prestashop.com/api/getAdviceImg/515.png\"/>\n				<p><b>Potenzia le tue vendite all\'estero!</b></p>\n				<p>Dal 30 al 70% degli acquirenti di tutta Europa preferisce pagare con metodi di pagamento locali. Con più di 150 metodi di pagamento, sosteniamo la tua espansione nei mercati di casa tua e oltre. Attiva i metodi di pagamento che ti interessano con un singolo contratto!</p>\n				<span class=\"text-right\" style=\"float:right\">\n					<a class=\"btn btn-default\" target=\"_blank\" href=\"https://gamification.prestashop.com/get_advice_link.php?id_advice=515&url=http%3A%2F%2Faddons.prestashop.com%2Fpl%2Fplatnosci-prestashop-moduly%2F1798-ogone.html%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3Dogone\">dowiedz się więcej?</a>\n				</span>\n			</div>\n		</section>\n			<script>\n			$(document).ready( function () {\n				$(\'#\'+rand(0)+\'_ogone\').show();\n			});\n\n			function rand(nbr){\n			   return Math.floor(Math.random()*(nbr+1));\n			}\n			</script>\n			</div>'),
