INSERT INTO `ps_cms_lang` VALUES
('1','1','1','Dostawy','Zasady i regulamin dostawy','dostawa,dostawy','<p>Towary są dostarczane wyłącznie na terenie Polski na adres dostawy podany przez internautę na zamówieniu. W momencie składania zamówienia na stronie www.enneatlon.pl internauta wybiera sposób dostawy. Sposób dostawy nie może zostać zmieniony w wypadku potwierdzenia złożenia zamówienia przez Sklep.</p>\n<p>Zamówienie może być dostarczone za pośrednictwem:</p>\n<ul><li> firmy kurierskiej DHL Sp. z o.o.</li>\n</ul><p><span>Zamówienia realizowane za pośrednictwem firmy kurierskiej DHL Sp. z o.o. doręczane są wyłącznie w dni robocze, w godzinach pracy oddziałów DHL Sp. z o.o.tj. od godziny 8:00 do godziny 17:00.</span></p>','dostawy'),
('2','1','1','Legal Notice','Legal notice','notice, legal, credits','<h2>Legal</h2>\n<h3>Credits</h3>\n<p>Concept and production:</p>\n<p>This Web site was created using <a href=\"http://www.prestashop.com\">PrestaShop</a>™ open-source software.</p>','legal-notice'),
('3','1','1','Regulamin strony internetowej','Regulamin i warunki korzystania ze sklepu Enneatlon','conditions, terms, use, sell,warunki,regulamin,korzystanie','<h3>Sklep internetowy działający pod adresem www.enneatlon.pl jest platformą prowadzoną przez: ENNEATLON sp. z o. o. z siedzibą w Warszawie, pod adresem ul. Malborska 53, <span>03-286</span> Warszawa, wpisaną do rejestru przedsiębiorców Krajowego Rejestru Sądowego, prowadzonego przez Sąd Rejonowy dla m.st. Warszawy w Warszawie, XIII Wydział Gospodarczy Krajowego Rejestru Sądowego pod nr KRS: 0000007163, NIP: 9511855233, REGON: 013102058, wysokość kapitału zakładowego: 8.000.280,00 zł, zwaną dalej „enneatlon.pl” lub „www.enneatlon.pl”.</h3>\n<h3>Niniejszy Regulamin Sklepu Internetowego www.enneatlon.pl zwany dalej „Ogólnymi Warunkami Sprzedaży” określa zasady korzystania ze sklepu internetowego działającego pod adresem „www.enneatlon”, składania zamówień na produkty dostępne w sklepie internetowym „www.enneatlon.pl”, dostarczania zamówionych produktów osobie dokonującej zakupów w sklepie internetowym „www.enneatlon” zwanej dalej „internautą”, uiszczania przez internautę ceny sprzedaży produktów, uprawnienia internauty do anulowania zamówienia i odstąpienia od umowy oraz zasady składania i rozpatrywania reklamacji.</h3>\n<h3>Internauta oraz enneatlon.pl łącznie zwani są dalej „stronami” lub indywidualnie „stroną”.Internauta oświadcza, że jest pełnoletni oraz posiada pełną zdolność do czynności prawnych lub posiada zgodę rodziców na zawarcie umowy z enneatlon.pl, co pozwala mu na dokonywanie zamówień w sklepie internetowym www.enneatlon.pl. </h3>\n<h3>Strony uzgadniają, że do łączących je stosunków prawnych będą miały zastosowanie niniejsze Ogólne Warunki Sprzedaży, które są dostępne na stronie www.enneatlon.pl, jak również powszechnie obowiązujące przepisy prawa, w tym w szczególności:</h3>\n<ol><li>\n<h3>1. Ustawa z dnia 30 maja 2014 roku o prawach konsumenta (Dz.U. z 2014 poz. 827)</h3>\n</li>\n<li>\n<h3>2. Ustawa z dnia 23 kwietnia 1964 Kodeks Cywilny (Dz.U.2014.121)</h3>\n</li>\n<li>\n<h3>3. Ustawa z dnia 23 września 2016 r. o pozasądowym rozwiązywaniu sporów konsumenckich</h3>\n</li>\n</ol><h3>Enneatlon.pl dokłada wszelkich starań by świadczone usługi w ramach sklepu internetowego www.enneatlon.pl były jak na najwyższym poziomie, jednakże enneatlon.pl nie wyklucza możliwości czasowego zawieszenia dostępności sklepu internetowego www.enneatlon.pl w przypadku konieczności przeprowadzenia konserwacji, przeglądu, wymiany sprzętu lub też w związku z koniecznością modernizacji lub rozbudowy strony www.enneatlon.pl</h3>','regulamin-strony'),
('4','1','1','O nas','Dowiedz się więcej o naszym sklepie','about us, informations,o nas,informacje','<h1 style=\"text-align:center;\"><span style=\"text-decoration:underline;\">Enneatlon sprawia by sport był dostępny dla wielu</span></h1>\n<h3>Od 2015 roku Enneatlon wprowadza innowacje, aby uczynić sport dostępnym dla każdego. Wychodząc naprzeciw potrzebom naszych klientów uruchomiliśmy sklep internetowy Enneatlon– dla wygody, swobodnego dostępu, oszczędności czasu i pieniędzy. Robimy wszystko, aby w naszych sklepach znaleźli Państwo najlepszej jakości sprzęt sportowy w okazyjnych cenach.</h3>','o-nas'),
('5','1','1','Secure payment','Our secure payment mean','secure payment, ssl, visa, mastercard, paypal','<h2>Secure payment</h2>\n<h3>Our secure payment</h3>\n<p>With SSL</p>\n<h3>Using Visa/Mastercard/Paypal</h3>\n<p>About this services</p>','secure-payment');
