INSERT INTO `ps_order_message_lang` VALUES
('1','1','Opóźnienie','Z przykrością zawiadamiamy, że ze względu na trudności logistyczne, dostarczenie paczki nastąpi później niż było planowane. Obecnie czekamy na dostawę artykułów z innego magazynu.\r\nPrzepraszamy, że tym razem nie dostarczyliśmy Twojego zamówienia tak szybko jak obiecywaliśmy.\r\nZaistniała sytuacja stanowi sytuację wyjątkową i mamy nadzieję, że mimo opóźnienia w realizacji zamówienia otrzymane produkty spełnią Twoje oczekiwania i dostarczą Ci wiele radości.\r\nPozdrawiamy,\r\nzaspół  Enneatlon\r\n');
