INSERT INTO `ps_product_lang` VALUES
('1','1','1','Połącz styl i techniczność: krój ubrania, oddychające materiały i cały tył z siateczki. Idealny top: pozwoli Ci spożytkować swoją energię i zapewni przy tym komfort. Szybko schnie.','Przeznaczenie: do fitnessu (trening cardio o umiarkowanej lub dużej intensywności).','top-damski-my-top',NULL,NULL,NULL,'Koszulka bez rękawów ENERGY+','Produkt dostępny','Możliwy zwrot produktu'),
('2','1','1','Połącz styl z technicznymi rozwiązaniami dzięki rozciągliwemu materiałowi i sportowemu designowi ubrania. Maksymalny komfort podczas zajęć wysiłku. Szybko schnie.','Przeznaczenie: do fitnessu (trening cardio o umiarkowanej intensywności).','koszulka-energy-do-fitnessu',NULL,NULL,NULL,'Koszulka ENERGY+ do fitnessu','Produkt dostępny','Możliwy zwrot produktu'),
('3','1','1','Ten stanik został opracowany z myślą o większych miseczkach. Dopasowuje się do najbardziej intensywnych ruchów fitness dzięki wyższemu poziomowi trzymania biustu!','Przeznaczenie: do treningu fitness cardio o dużych wstrząsach (jump, skakanka). Odpowiedni do biegania i sportów rakietowych.','stanik-fitness-power',NULL,NULL,NULL,'Stanik fitness Power','Produkt dostępny','Możliwy zwrot produktu'),
('4','1','1','Ta koszulka z krótkim rękawem podkreśla linię sylwetki. Design tego klasycznego ubrania o kroju blisko ciała i dekoltowi w serek został modnie odświeżony. Lekki materiał zapewnia suchą skórę.','Przeznaczenie: do fitnessu (trening cardio o niedużej lub umiarkowanej intensywności).','koszulka-energy-do-fitnessu',NULL,NULL,NULL,'Koszulka ENERGY do fitnessu','Produkt dostępny','Możliwy zwrot produktu'),
('5','1','1','Kobiecy top o sportowym designie. Możesz swobodnie trenować: techniczny, oddychający materiał z tyłu usprawnia odprowadzanie wilgoci. Szybko schnie.','Przeznaczenie: do fitnessu (trening cardio o niedużej lub umiarkowanej intensywności).','koszulka-bez-rekawow-energy',NULL,NULL,NULL,'Koszulka bez rękawów ENERGY','Produkt dostępny','Możliwy zwrot produktu'),
('6','1','1','Ten stanik nie posiada szwów przy biuście, ani fiszbin. Zintegrowana pianka i lekki materiał zapewniają efekt drugiej skóry. Pasuje szczególnie do niewielkich biustów.','Przeznaczenie: do zajęć fitness (cardio) o niedużej intensywności: indoor cycling, wzmacnianie mięśni. Odpowiedni do jogi, stretchingu, pilatesu.','stanik-confort-do-fitnessu',NULL,NULL,NULL,'Stanik CONFORT + do fitnessu','Produkt dostępny','Możliwy zwrot produktu'),
('7','1','1','Połącz styl z osiągami dzięki bardzo miękkiemu materiałowi z efektem drugiej skóry, przewiewnej wstawce i kolorowemu nadrukowi graficznemu.','Przeznaczenie: do fitnessu (trening cardio o umiarkowanej lub dużej intensywności).','legginsy-7-8-fitness-energy-',NULL,NULL,NULL,'Legginsy 7/8 fitness Energy +','Produkt dostępny','Możliwy zwrot produktu'),
('8','1','1','Ta luźna koszulka zapewnia swobodę podczas zajęć sportowych: techniczny, oddychający materiał z tyłu usprawnia odprowadzanie wilgoci. Możesz nosić ją samą lub zestawić z topem My top.','Przeznaczenie: do fitnessu (trening cardio o niedużej lub umiarkowanej intensywności).','koszulka-energy-do-fitnessu',NULL,NULL,NULL,'Koszulka ENERGY do fitnessu','Produkt dostępny','Możliwy zwrot produktu'),
('9','1','1','<p>Połącz styl z osiągami dzięki bardzo miękkiemu materiałowi z efektem drugiej skóry, przewiewnej wstawce i kolorowemu nadrukowi graficznemu.</p>','<p>Przeznaczenie: do fitnessu (trening cardio o umiarkowanej lub dużej intensywności).</p>','legginsy-energy-fitness',NULL,NULL,NULL,'Legginsy ENERGY+ fitness','Produkt dostępny','Możliwy zwrot produktu'),
('10','1','1','<p>Te legginsy zostały opracowane tak, aby wyszczuplały Twoją sylwetkę: posiadają szeroki pasek zapewniający efekt płaskiego brzucha. Dostępne są w wersji czarnej lub granatowej z nadrukiem na nogawce.</p>','<p>Przeznaczenie: do fitnessu (zajęcia ujędrniające i wzmacniające mięśnie) o małej lub dużej intensywności.</p>','legginsy-shape-fitness',NULL,NULL,NULL,'Legginsy SHAPE fitness','Produkt dostępny','Możliwy zwrot produktu'),
('11','1','1','Wygodny stanik dzięki miękkiemu materiałowi z bawełny. Bardzo kobiece ramiączka. Pasuje szczególnie do niewielkich biustów.','Przeznaczenie: do treningu fitness cardio o niedużych wstrząsach: indoor cycling, wzmacnianie mięśni. Odpowiedni do jogi, stretchingu, pilatesu.','stanik-confort-do-fitnessu',NULL,NULL,NULL,'Stanik CONFORT do fitnessu','Produkt dostępny','Możliwy zwrot produktu'),
('12','1','1','Legginsy stworzone dla chcących przekroczyć swoje limity! Oddychający materiał i techniczne detale pozwalają stale zwiększać intensywność treningu. Modny wygląd dzięki dwóm kolorom!','Przeznaczenie: do fitnessu (trening cardio o dużej intensywności).','legginsy-energy-xtrem',NULL,NULL,NULL,'Legginsy ENERGY XTREM','Produkt dostępny','Możliwy zwrot produktu'),
('13','1','1','Niezbędny element garderoby fitness w przyjemnej cenie: oddychający i rozciągliwy materiał, krój zapewniający komfort noszenia i całkowitą swobodę ruchów.','Przeznaczenie: do fitnessu (trening cardio o niedużej lub umiarkowanej intensywności).','legginsy-energy-do-fitnessu',NULL,NULL,NULL,'Legginsy ENERGY do fitnessu','Produkt dostępny','Możliwy zwrot produktu'),
('14','1','1','Techniczna koszulka bez rękawów. Podtrzymuje biust, posiada oddychającą wstawkę na plecach i szeroki pasek z miękkiego materiału pod biustem.','Przeznaczenie: do fitnessu (trening cardio o umiarkowanej lub dużej intensywności).','koszulka-bez-rekawow-energy',NULL,NULL,NULL,'Koszulka bez rękawów ENERGY+','Produkt dostępny','Możliwy zwrot produktu'),
('15','1','1','Niezastąpiony element stroju do fitnessu (cardio)! Zintegrowane, oddychające pianki i plecy w literę X usprawniają odprowadzanie wilgoci. Modne kolory i nadruki.','Przeznaczenie: do zajęć fitness (cardio) o umiarkowanych wstrząsach (cardiobox, aerodance). Odpowiedni także do tańca i treningu crossowego.','stanik-fitness-energy',NULL,NULL,NULL,'Stanik fitness ENERGY+','Produkt dostępny','Możliwy zwrot produktu'),
('16','1','1','Niezastąpiony element stroju do fitnessu (cardio)! Zintegrowane, oddychające pianki i plecy w literę X usprawniają odprowadzanie wilgoci. Modne kolory i nadruki.','Przeznaczenie: do treningu fitness cardio o dużych wstrząsach (jump, skakanka). Odpowiedni do biegania i sportów rakietowych.','stanik-fitness-energy-zip',NULL,NULL,NULL,'Stanik fitness Energy + Zip','Produkt dostępny','Możliwy zwrot produktu'),
('17','1','1','Legginsy 7/8 - stworzone dla chcących przekroczyć swoje limity! Oddychający materiał i techniczne detale pozwalają stale zwiększać intensywność treningu. Kolorowe wstawki zapewniają modny wygląd.','Przeznaczenie: do fitnessu (trening cardio o dużej intensywności).','legginsy-7-8-energy-xtrem',NULL,NULL,NULL,'Legginsy 7/8 ENERGY XTREM','Produkt dostępny','Możliwy zwrot produktu'),
